    return (
        <div className='input-info'>
            <Select size='x-large' placeholder='Select your country' options={countryOptions} />
            <Select size='x-large' placeholder='Select your country' options={countryOptions} />
            <Select size='x-large' placeholder='Select your country' options={countryOptions} />
            <Select size='x-large' placeholder='Select your country' options={countryOptions} />

        </div>
    )
}

export default InputSection
